import React, { useState } from 'react';
import './css/ListeVideo.css';

const ListeVideo = ({ selectedVideo }) => {
  const [activeTab, setActiveTab] = useState('VIDEO');
  const [shareOpen, setShareOpen] = useState(false); // State to control share buttons

  const handleClick = (event) => {
    const videoElement = event.target;
  };

  const handleDoubleClick = (event) => {
    const videoElement = event.target;

    if (videoElement.requestFullscreen) {
      videoElement.requestFullscreen();
    } else if (videoElement.mozRequestFullScreen) {
      videoElement.mozRequestFullScreen();
    } else if (videoElement.webkitRequestFullscreen) {
      videoElement.webkitRequestFullscreen();
    } else if (videoElement.msRequestFullscreen) {
      videoElement.msRequestFullscreen();
    }
  };

  const handleTabClick = (tab) => {
    setActiveTab(tab);
  };

  const handleShareClick = () => {
    setShareOpen(!shareOpen); // Toggle share buttons visibility
  };

  return (
    <div className="liste-video-container">   
      <div className="liste-video-wrapper">    
        <div className="liste-video-content">
          <nav className="tabs">
            <button
              className={activeTab === 'VIDEO' ? 'active' : ''}
              onClick={() => handleTabClick('VIDEO')}
            >
              Vidéo
            </button>
            <button
              className={activeTab === 'RESUME' ? 'active' : ''}
              onClick={() => handleTabClick('RESUME')}
            >
              Résumé
            </button>
            <button
              className={activeTab === 'STATSEQUIPES' ? 'active' : ''}
              onClick={() => handleTabClick('STATSEQUIPES')}
            >
              Stats Équipes
            </button>
            <button
              className={activeTab === 'STATSJOUEURS' ? 'active' : ''}
              onClick={() => handleTabClick('STATSJOUEURS')}
            >
              Stats Joueurs
            </button>
          </nav>

          <div className="tab-content">
            {activeTab === 'VIDEO' && selectedVideo ? (
              <video
                className="liste-video-content-video"
                src={selectedVideo.url}
                poster="/ImageDeConverture-c.jpg" 
                controls
                onClick={handleClick}
              >
                <p>
                  Votre navigateur ne supporte pas la vidéo HTML5. Voici un{' '}
                  <a href={selectedVideo.url}>lien vers la vidéo</a> à la place.
                </p>
              </video>
            ) : activeTab === 'RESUME' && selectedVideo ? (

              <div>
                <video
                  className="liste-video-content-video"
                  src={selectedVideo.url}
                  poster="/ImageDeConverture-r.jpg" 
                  controls
                  onClick={handleClick}
                >
                  <p>
                    Votre navigateur ne supporte pas la vidéo HTML5. Voici un{' '}
                    <a href={selectedVideo.url}>lien vers la vidéo</a> à la place.
                  </p>
                </video>
                
                {/* Share Button */}
                <div className="share-section">
                  <button className="share-button" onClick={handleShareClick}>
                    Partager
                  </button>

                  {/* Social Media Buttons */}
                  {shareOpen && (
                    <div className="social-buttons">
                      <a href="https://facebook.com" target="_blank" rel="noopener noreferrer" className="social-button facebook">Facebook</a>
                      <a href="https://instagram.com" target="_blank" rel="noopener noreferrer" className="social-button instagram">Instagram</a>
                      <a href="https://tiktok.com" target="_blank" rel="noopener noreferrer" className="social-button tiktok">TikTok</a>
                      <a href="https://youtube.com" target="_blank" rel="noopener noreferrer" className="social-button youtube">YouTube</a>
                    </div>
                  )}
                </div>
              </div>
          
            ) : activeTab === 'STATSEQUIPES' ? (
              <div className="video-comments">
                <img src="/stat equipe.jpg" alt="Stats Équipes" className="stats-equipe-image" />
              </div>
            ) : activeTab === 'STATSJOUEURS' ? (
              <div className="video-others">
                <img src="/stat joueur.jpg" alt="Stats Joueurs" className="stats-equipe-image" />
              </div>
            ) : null}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ListeVideo;
